TITLE: Adding a New Pet to the Store using Java
DESCRIPTION: This snippet demonstrates how to add a new pet to the store using the PetApi. It configures OAuth2 authentication, creates a Pet object, and calls the addPet method. The method handles potential ApiExceptions.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/client/petstore/java/okhttp4-gson/docs/PetApi.md#2025-04-20_snippet_0

LANGUAGE: java
CODE:
```
// Import classes:
//import io.swagger.client.ApiClient;
//import io.swagger.client.ApiException;
//import io.swagger.client.Configuration;
//import io.swagger.client.auth.*;
//import io.swagger.client.api.PetApi;

ApiClient defaultClient = Configuration.getDefaultApiClient();

// Configure OAuth2 access token for authorization: petstore_auth
OAuth petstore_auth = (OAuth) defaultClient.getAuthentication("petstore_auth");
petstore_auth.setAccessToken("YOUR ACCESS TOKEN");

PetApi apiInstance = new PetApi();
Pet body = new Pet(); // Pet | Pet object that needs to be added to the store
try {
    apiInstance.addPet(body);
} catch (ApiException e) {
    System.err.println("Exception when calling PetApi#addPet");
    e.printStackTrace();
}
```

