TITLE: Finding Pets by Status using Java Swagger Client
DESCRIPTION: Example code showing how to retrieve pets filtered by status using the PetApi with OAuth2 authentication. The status values can be provided as comma-separated strings, with valid options being 'available', 'pending', or 'sold'.
