TITLE: Updating an existing pet using Python
DESCRIPTION: Example code for updating an existing pet in the Petstore API using Python. Requires OAuth2 authentication with the petstore_auth token and a Pet object containing the updated pet details.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/client/petstore/python-tornado/docs/PetApi.md#2025-04-20_snippet_5

LANGUAGE: python
CODE:
```
from __future__ import print_function
import time
import petstore_api
from petstore_api.rest import ApiException
from pprint import pprint

# Configure OAuth2 access token for authorization: petstore_auth
configuration = petstore_api.Configuration()
configuration.access_token = 'YOUR_ACCESS_TOKEN'

# create an instance of the API class
api_instance = petstore_api.PetApi(petstore_api.ApiClient(configuration))
body = petstore_api.Pet() # Pet | Pet object that needs to be added to the store

try:
    # Update an existing pet
    api_instance.update_pet(body)
except ApiException as e:
    print("Exception when calling PetApi->update_pet: %s\n" % e)
