TITLE: Adding a New Pet to the Store in Ruby
DESCRIPTION: Example code demonstrating how to add a new pet to the store using the Petstore Ruby client. It loads the required gem, configures OAuth2 access token for authorization, instantiates the PetApi class, and makes the API call with a Pet object.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/client/petstore/ruby/docs/PetApi.md#2025-04-20_snippet_0

LANGUAGE: ruby
CODE:
```
# load the gem
require 'petstore'
# setup authorization
Petstore.configure do |config|
  # Configure OAuth2 access token for authorization: petstore_auth
  config.access_token = 'YOUR ACCESS TOKEN'
end

api_instance = Petstore::PetApi.new

body = Petstore::Pet.new # Pet | Pet object that needs to be added to the store


begin
  #Add a new pet to the store
  api_instance.add_pet(body)
rescue Petstore::ApiError => e
  puts "Exception when calling PetApi->add_pet: #{e}"
end
```

