TITLE: Uploading a File to a Pet Record with Swagger Petstore JavaScript Client
DESCRIPTION: This code snippet demonstrates how to use the Swagger Petstore JavaScript client to upload a file to a pet's record. It configures OAuth2 authentication, creates a PetApi instance, sets required parameters including the pet ID and optional metadata and file path, and executes the uploadFile method with a callback to handle the response.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/client/petstore/javascript/docs/PetApi.md#2025-04-20_snippet_8

LANGUAGE: javascript
CODE:
```
var SwaggerPetstore = require('swagger_petstore');
var defaultClient = SwaggerPetstore.ApiClient.instance;

// Configure OAuth2 access token for authorization: petstore_auth
var petstore_auth = defaultClient.authentications['petstore_auth'];
petstore_auth.accessToken = 'YOUR ACCESS TOKEN';

var apiInstance = new SwaggerPetstore.PetApi();

var petId = 789; // Number | ID of pet to update

var opts = { 
  'additionalMetadata': "additionalMetadata_example", // String | Additional data to pass to server
  'file': "/path/to/file.txt" // File | file to upload
};

var callback = function(error, data, response) {
  if (error) {
    console.error(error);
  } else {
    console.log('API called successfully. Returned data: ' + data);
  }
};
apiInstance.uploadFile(petId, opts, callback);
```

