TITLE: Using Swagger Generator Docker Image for Code Generation
DESCRIPTION: This complex example demonstrates how to use the Swagger Generator Docker image as a self-hosted web application and API for generating code. It includes starting the container, getting its IP, making an HTTP request to generate code, and downloading the result.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/docs/docker.md#2025-04-20_snippet_3

LANGUAGE: sh
CODE:
```
# Start container and save the container id
CID=$(docker run -d swaggerapi/swagger-generator)
# allow for startup
sleep 5
# Get the IP of the running container
GEN_IP=$(docker inspect --format '{{.NetworkSettings.IPAddress}}'  $CID)
# Execute an HTTP request and store the download link
RESULT=$(curl -X POST --header 'Content-Type: application/json' --header 'Accept: application/json' -d '{
  "swaggerUrl": "https://petstore.swagger.io/v2/swagger.json"
}' 'http://localhost:8188/api/gen/clients/javascript' | jq '.link' | tr -d '"')
# Download the generated zip and redirect to a file
curl $RESULT > result.zip
# Shutdown the swagger generator image
docker stop $CID && docker rm $CID
```

