TITLE: Parsing Command-Line Arguments for SwaggerPetstore Server in Haskell
DESCRIPTION: This snippet demonstrates how to use the optparse-applicative library to parse command-line arguments for host and port when running a SwaggerPetstore server. It defines a main function that parses arguments and runs the server, and a helper function to handle the argument parsing.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/server/petstore/haskell-servant/README.md#2025-04-20_snippet_2

LANGUAGE: haskell
CODE:
```
{-# LANGUAGE RecordWildCards #-}

module Main (main) where

import SwaggerPetstore.API (runSwaggerPetstoreServer, SwaggerPetstoreBackend(..), ServerConfig(..))

import Control.Applicative ((<$>), (<*>))
import Options.Applicative (execParser, option, str, auto, long, metavar, help)

main :: IO ()
main = do
  config <- parseArguments
  runSwaggerPetstoreServer config SwaggerPetstoreBackend{}

-- | Parse host and port from the command line arguments.
parseArguments :: IO ServerConfig
parseArguments =
  execParser $
    ServerConfig
      <$> option str  (long "host" <> metavar "HOST" <> help "Host to serve on")
      <*> option auto (long "port" <> metavar "PORT" <> help "Port to serve on")
```

