TITLE: Configuring Authentication for Swift API Client
DESCRIPTION: This Swift code provides a helper method for configuring API client authentication. It supports multiple authentication methods including API key, OAuth, and basic authentication. The method handles adding necessary headers and query parameters based on the authentication type.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/server/petstore/rails5/tmp/restart.txt#2025-04-20_snippet_0

LANGUAGE: Swift
CODE:
```
// Configure auth settings
private func configureAuthSettings() throws {
    guard !self.authSettings.isEmpty else {
        return
    }

    // Apply authentication settings to the request
    for (key, value) in authSettings {
        guard let authConfig = ApiClient.apiKey[key] else {
            continue
        }

        // Skip auth settings that were not applied to this request.
        if let authType = authConfig["in"], value["in"] != nil && authType != value["in"] {
            continue
        }

        let authSetting = authConfig
        let authSettingValues = value

        switch (authSetting["in"]) {
        case "header":
            if let apiKey = authSettingValues["value"], let keyPrefix = authSetting["key_prefix"] {
                self.addHeaders([authSetting["key"]: "\(keyPrefix) \(apiKey)"])
            } else if let apiKey = authSettingValues["value"] {
                self.addHeaders([authSetting["key"]: apiKey])
            }
        case "query":
            if let apiKey = authSettingValues["value"] {
                self.addQueryParameters([authSetting["key"]: apiKey])
            }
        case "basic":
            let username = authSettingValues["username"] ?? ""
            let password = authSettingValues["password"] ?? ""
            self.addHeaders(["Authorization": "Basic \(HTTPClient.base64Encode(string: "\(username):\(password)"))")
        case "oAuth":
            if let apiKey = authSettingValues["value"] {
                self.addHeaders([authSetting["key"]: "Bearer \(apiKey)"])
            }
        default:
            break
        }
    }
}
```

