TITLE: Using EventDispatcher for API Calls in Flash/ActionScript
DESCRIPTION: This code demonstrates how to use the Swagger-generated Flash client library in an application. It shows the implementation of event handling for API responses using an EventDispatcher, including credential setup, event listener registration, and API method invocation.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/client/petstore/flash/flash/README.txt#2025-04-20_snippet_0

