TITLE: Finding Pets by Status using SwaggerPetstore PetApi in JavaScript
DESCRIPTION: This snippet demonstrates how to find pets by their status using the SwaggerPetstore PetApi. It sets up OAuth2 authentication and makes an API call to retrieve pets filtered by their status.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/client/petstore/javascript-override-default-config/docs/PetApi.md#2025-04-20_snippet_2

LANGUAGE: javascript
CODE:
```
var SwaggerPetstore = require('swagger_petstore');
var defaultClient = SwaggerPetstore.ApiClient.instance;

// Configure OAuth2 access token for authorization: petstore_auth
var petstore_auth = defaultClient.authentications['petstore_auth'];
petstore_auth.accessToken = 'YOUR ACCESS TOKEN';

var apiInstance = new SwaggerPetstore.PetApi();

var status = ["status_example"]; // [String] | Status values that need to be considered for filter


var callback = function(error, data, response) {
  if (error) {
    console.error(error);
  } else {
    console.log('API called successfully. Returned data: ' + data);
  }
};
apiInstance.findPetsByStatus(status, callback);
```

