TITLE: Creating a User Model with ResponseObjectSerializable in Swift
DESCRIPTION: Implements a User model class that conforms to ResponseObjectSerializable, allowing automatic conversion from HTTP responses and JSON data into typed objects. The class extracts username from the URL and name from the JSON response.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/client/petstore/swift/promisekit/SwaggerClientTests/Pods/Alamofire/README.md#2025-04-20_snippet_45

LANGUAGE: swift
CODE:
```
final class User: ResponseObjectSerializable {
    let username: String
    let name: String

    init?(response: NSHTTPURLResponse, representation: AnyObject) {
        self.username = response.URL!.lastPathComponent!
        self.name = representation.valueForKeyPath("name") as! String
    }
}
```

