TITLE: FastRoute Optional Route Segments
DESCRIPTION: Shows how to define routes with optional parts using square brackets. Explains the equivalence between routes with optional parts and multiple explicit routes, and demonstrates limitations of optional segment placement.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/server/petstore-security-test/slim/vendor/nikic/fast-route/README.md#2025-04-20_snippet_4

LANGUAGE: php
CODE:
```
// This route
$r->addRoute('GET', '/user/{id:\d+}[/{name}]', 'handler');
// Is equivalent to these two routes
$r->addRoute('GET', '/user/{id:\d+}', 'handler');
$r->addRoute('GET', '/user/{id:\d+}/{name}', 'handler');

// Multiple nested optional parts are possible as well
$r->addRoute('GET', '/user[/{id:\d+}[/{name}]]', 'handler');

// This route is NOT valid, because optional parts can only occur at the end
$r->addRoute('GET', '/user[/{id:\d+}]/{name}', 'handler');
```

