TITLE: Implementing URLRequestConvertible for API Parameter Abstraction in Swift
DESCRIPTION: Creates a Router enum that conforms to URLRequestConvertible for API parameter abstraction. The implementation handles search queries with pagination, converting enum cases into appropriate URL requests with query parameters.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/client/petstore/swift/promisekit/SwaggerClientTests/Pods/Alamofire/README.md#2025-04-20_snippet_54

LANGUAGE: swift
CODE:
```
enum Router: URLRequestConvertible {
    static let baseURLString = "http://example.com"
    static let perPage = 50

    case Search(query: String, page: Int)

    // MARK: URLRequestConvertible

    var URLRequest: NSMutableURLRequest {
        let result: (path: String, parameters: [String: AnyObject]) = {
            switch self {
            case .Search(let query, let page) where page > 0:
                return ("/search", ["q": query, "offset": Router.perPage * page])
            case .Search(let query, _):
                return ("/search", ["q": query])
            }
        }()

        let URL = NSURL(string: Router.baseURLString)!
        let URLRequest = NSURLRequest(URL: URL.URLByAppendingPathComponent(result.path))
        let encoding = Alamofire.ParameterEncoding.URL

        return encoding.encode(URLRequest, parameters: result.parameters).0
    }
}
```

