TITLE: Configuring PetStoreTest Project Build with CMake
DESCRIPTION: This CMake configuration file sets up the build environment for the PetStoreTest project. It defines dependencies (glib-2.0, json-glib-1.0, libcurl), compiler flags, includes source files from both local and parent directories, and configures linking against required libraries. The output executable is placed in the bin directory.
