TITLE: Creating a Custom XML Response Serializer for Alamofire
DESCRIPTION: This snippet demonstrates how to extend Alamofire.Request to add custom response serialization. It creates an XML response serializer using the Ono library and handles various error cases through the custom BackendError type.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/client/petstore/swift/promisekit/SwaggerClientTests/Pods/Alamofire/README.md#2025-04-20_snippet_43

LANGUAGE: swift
CODE:
```
extension Request {
    public static func XMLResponseSerializer() -> ResponseSerializer<ONOXMLDocument, BackendError> {
        return ResponseSerializer { request, response, data, error in
            guard error == nil else { return .Failure(.Network(error: error!)) }

            guard let validData = data else {
                return .Failure(.DataSerialization(reason: "Data could not be serialized. Input data was nil."))
            }

            do {
                let XML = try ONOXMLDocument(data: validData)
                return .Success(XML)
            } catch {
                return .Failure(.XMLSerialization(error: error as NSError))
            }
        }
    }

    public func responseXMLDocument(completionHandler: Response<ONOXMLDocument, BackendError> -> Void) -> Self {
        return response(responseSerializer: Request.XMLResponseSerializer(), completionHandler: completionHandler)
    }
}
```

