TITLE: Defining ContainerInterface in PHP
DESCRIPTION: This snippet defines the ContainerInterface, which exposes two methods: get() for retrieving entries and has() for checking entry existence. It includes method signatures with parameters, return types, and potential exceptions.
SOURCE: https://github.com/swagger-api/swagger-codegen/blob/master/samples/server/petstore/slim/vendor/container-interop/container-interop/docs/ContainerInterface.md#2025-04-20_snippet_0

LANGUAGE: php
CODE:
```
<?php
namespace Interop\Container;

use Interop\Container\Exception\ContainerException;
use Interop\Container\Exception\NotFoundException;

/**
 * Describes the interface of a container that exposes methods to read its entries.
 */
interface ContainerInterface
{
    /**
     * Finds an entry of the container by its identifier and returns it.
     *
     * @param string $id Identifier of the entry to look for.
     *
     * @throws NotFoundException  No entry was found for this identifier.
     * @throws ContainerException Error while retrieving the entry.
     *
     * @return mixed Entry.
     */
    public function get($id);

    /**
     * Returns true if the container can return an entry for the given identifier.
     * Returns false otherwise.
     *
     * @param string $id Identifier of the entry to look for.
     *
     * @return boolean
     */
    public function has($id);
}
```

