TITLE: Defining GitHub Repository Search in Swift using RxSwift
DESCRIPTION: This code snippet demonstrates how to define a search for GitHub repositories using RxSwift. It throttles user input, performs distinct checks, and flat maps the search query to an observable sequence of repository results.
